// ----------------------------------------
// CHART - HALF DOUGHNUT WITH GAUGE
// ----------------------------------------
$.fn.chartDoughnutGauge = function (options) {

  var defaults = {
    background_color: '',
    value: '',
    gauge_limits: ''
  };

  var opts = $.extend({}, defaults, options);

  // -------------
  // CANVAS
  // -------------
  var ctx = this.find('canvas')[0].getContext("2d");

  new Chart(ctx, {
    type: "tsgauge",
    data: {
      datasets: [{
        backgroundColor: opts.background_color,
        borderWidth: 0,
        gaugeData: {
          value: opts.value,
          valueColor: "#ff7143"
        },
        gaugeLimits: opts.gauge_limits
      }]
    },
    options: {
      events: [],
      showMarkers: true
    }
  });

  // -------------
  // RUN STARS
  // -------------
  var $star = this.find('.stars');

  var stars = function stars(data) {

    var value_rounded = Math.round(data * 2) / 2;
    var value_floored = Math.floor(data);
    var cache_val = 0;
    var html = '';

    for (var i = 0; i < 5; i++) {
      // 

      if (i < value_floored) {
        html += '<i class="fas fa-star"></i>';
      } else {
        // value_other.push(i)
        if (value_rounded % 1 != 0 && cache_val == 0) {
          html += '<i class="fas fa-star-half-alt"></i>';

          cache_val = 1;
        } else {
          html += '<i class="far fa-star"></i>';
        }
      }
    }

    $star.html(html);
  };

  stars(opts.value);

  // -------------
  // 
  // -------------
  this.find('.show-value').html(opts.value);
};

