$.fn.chartCustomPercentBar = function (options) {
  var defaults = {
    y_axis: {
      line: {
        min: 0,
        max: 100,
        div: 5
      },

      legend: 'ticket percentage (%)'
    },

    tooltip: {
      value: 'below min. target'
    },

    data: {
      value: 65,
      min: 80
    }
  };

  var opts = $.extend({}, defaults, options);
  var $bar = this.find('.bar');

  var line_min = opts.y_axis.line.min;
  var line_max = opts.y_axis.line.max;
  var line_div = opts.y_axis.line.div;
  var min_value = opts.data.min;
  var data_value = opts.data.value;

  var html_line = '<ul class="line">';
  var html_min_line = '<ul class="min-line">';
  var html_y_axis_label = '<ul class="line-label">';
  var html_tooltip = '<ul class="tooltip-wrap">';
  var html_data_value = '<div class="data-value" style="clip-path: inset(' + (100 - data_value) + '% 0 0 0)"></div>';

  for (var i = line_max; i >= 0; i -= 5) {
    html_line += '<li></li>';

    if (i == min_value) {
      // 
      html_min_line += '<li class="active">' + '<div class="label">min target</div>' + '</li>';
    } else {
      html_min_line += '<li></li>';
    }

    if (data_value == i) {
      html_tooltip += '<li>' + '<div class="bubble">' + data_value + '% tickets are ' + opts.tooltip.value + '</div>' + '</li>';
    } else {
      html_tooltip += '<li></li>';
    }

    if (i % (line_max / line_div) == 0) {
      html_y_axis_label += '<li>' + i + '</li>';
    }
  }

  html_line += '</ul>';
  html_min_line += '</ul>';
  html_y_axis_label += '</ul>';
  html_tooltip += '</ul>';

  $bar.html('');

  setTimeout(function () {
    $bar.append(html_line).append(html_min_line).append(html_y_axis_label).append(html_data_value).append(html_tooltip);
  }, 100);

  // -------------------
  // Y AXIS LEGEND
  // -------------------
  var html_y_axis_legend = '<div class="y-legend">' + opts.y_axis.legend + '</div>';

  $bar.parents('.canvas-wrap').find('.y-legend').remove();

  setTimeout(function () {
    $bar.parents('.canvas-wrap').append(html_y_axis_legend);
  }, 100);
};

