window.paramsObjSeparator = function (params_obj) {
  var params = '';
  var separator = '';

  Object.keys(params_obj).forEach(function (el, i) {
    separator = i == 0 ? '?' : '&';

    var obj_key = params_obj[el].split('&').length > 1 ? '' : el + '=';

    params += separator + obj_key + params_obj[el];
  });

  return params;
};

// --------------------------
