window.obj2params = function (data, api) {
  var params = '';
  var separator = void 0;

  Object.keys(data).forEach(function (el, i) {
    // separator = ( i == 0 ) ? '?' : '&'

    if (i == 0) {
      if (api != undefined && api != '' && api.split('?').length > 1) {
        separator = '&';
      } else {
        separator = '?';
      }
    } else {
      separator = '&';
    }

    params += separator + el + '=' + data[el];
  });

  return params;
};

